import React, { useState } from "react";
import "./style.css";
const students = [
  { name: "Adi", age: 22 },
  { name: "sara", age: 19 },
];
function App() {
  const [show,setShow] = useState(false)

  return (
    <div className="ret">
      hello
      <li type="submit" onClick={()=>setShow(currentShow => !currentShow)}>
        Submit
      <table>
        <thead>
          <th>
            <tr>name</tr>
            <tr>age</tr>
          </th>
        </thead>
        <tbody>
          {students.map((val) => {
            return (
              <tr>
                <tr>{val.name}</tr>
                <tr>{val.age}</tr>
              </tr>
            );
          })}
        </tbody>
      </table>
      </li>
    </div>
  );
}

export default App;
